function filterOne(inp, condB, keyV) {
	startSelection = inp;
	if (condB > 0) {
		thisSelection = []
		for (var i=0; i<startSelection.length; i++) {
			if (startSelection[i][keyV] >= condB) {
				thisSelection.push(startSelection[i])
			}
		}
		if (thisSelection.length === 0)
			{return inp}
		else {return thisSelection}
	}
	else {
		return inp;
	}
}

