function translateMaxToStartingPoint (maxx) {
	if (maxx === 5) {
		return 0;
	}
	else if (maxx === 4) {
		return 1;
	}
	else if (maxx === 3) {
		return 2;
	}
	else if (maxx === 2) {
		return 3;
	}
	else if (maxx === 1) {
		return 4;
	}
}

function translateStartingPointToMax (maxx) {
	if (maxx === 0) {
		return 5;
	}
	else if (maxx === 1) {
		return 4;
	}
	else if (maxx === 2) {
		return 3;
	}
	else if (maxx === 3) {
		return 2;
	}
	else if (maxx === 4) {
		return 1;
	}
}

function breakup(x) {
	var new_x = [];
	var this_x = [];
	for (var i = 1; i < x.length + 1; i++) {
        // console.log(i)
        if (i % 9 === 0) {
        	this_x.push(x[i-1]);
        	new_x.push(this_x);
        	this_x = [];
        }
        else if (i === x.length) {
        	this_x.push(x[i-1]);
        	new_x.push(this_x);
        }
        else {
        	this_x.push(x[i-1]);
        }
    }
    return (new_x);
}

